import React, { useState } from "react";
import { FaEdit, FaTrash } from "react-icons/fa";

function TodoList() {
  const [todos, setTodos] = useState([
    { id: 1, task: "Learn Flask", description: "Understand Flask basics" },
    { id: 2, task: "Build API", description: "Create CRUD endpoints" },
  ]);

  const handleDelete = (id) => {
    setTodos(todos.filter((todo) => todo.id !== id));
  };

  return (
    <div className="todo-list-page mx-auto mt-5 shadow p-4 bg-white rounded">
      <h3 className="text-center mb-4 text-primary">Your Todos</h3>

      {todos.length === 0 ? (
        <p className="text-center text-muted">No todos yet.</p>
      ) : (
        <table className="table table-striped align-middle">
          <thead>
            <tr>
              <th>#</th>
              <th>Task</th>
              <th>Description</th>
              <th className="text-end">Actions</th>
            </tr>
          </thead>
          <tbody>
            {todos.map((todo, index) => (
              <tr key={todo.id}>
                <td>{index + 1}</td>
                <td>{todo.task}</td>
                <td>{todo.description}</td>
                <td className="text-end">
                  <button className="btn btn-sm btn-outline-success me-2">
                    <FaEdit />
                  </button>
                  <button
                    className="btn btn-sm btn-outline-danger"
                    onClick={() => handleDelete(todo.id)}
                  >
                    <FaTrash />
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default TodoList;
